import styled from "styled-components";

export const STop = styled.div`
  color: #FFFFFF;
  padding: 20px;
  display: flex;

  p {
    margin: 0;
  }

  img {
    width: 14px;
    height: 14px;
    color: #FFFFFF;
  }

  svg {
    margin-right: 7px;
  }
`

export const SSection = styled.div`
  color: #FFFFFF;
  padding: 0 20px;
`
